-- 5. Inserção de Dados Fictícios


-- Resetar as sequências para garantir que o próximo INSERT sem ID explícito funcione corretamente
-- Isso é necessário quando se insere dados com IDs explícitos em colunas SERIAL.

SELECT setval('tutor_id_tutor_seq', (SELECT MAX(id_tutor) FROM TUTOR));
SELECT setval('veterinario_id_veterinario_seq', (SELECT MAX(id_veterinario) FROM VETERINARIO));
SELECT setval('animal_id_animal_seq', (SELECT MAX(id_animal) FROM ANIMAL));
SELECT setval('prontuario_id_prontuario_seq', (SELECT MAX(id_prontuario) FROM PRONTUARIO));
SELECT setval('consulta_id_consulta_seq', (SELECT MAX(id_consulta) FROM CONSULTA));
SELECT setval('produto_servico_id_produto_servico_seq', (SELECT MAX(id_produto_servico) FROM PRODUTO_SERVICO));
